// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import './ERC721.sol';


contract ERC721Enumerable is ERC721 {
    uint256[] private _allTokens;

    //mapping form tokenId to position in array _allTokens
    mapping(uint256 => uint256) private _tokenIdToIndex;

    //mapping of owner to list of all owner's tokens
    mapping(address => uint256[]) private _ownerToTokens;

    //mapping from the tokenId of the owner token list
    mapping(uint256 => address) private _tokenIdToOwner;

     /// @notice Count NFTs tracked by this contract
    /// @return A count of valid NFTs tracked by this contract, where each one of
    ///  them has an assigned and queryable owner not equal to the zero address
    function totalSupply() public view returns (uint256){
        return _allTokens.length;
    }

    //override _mint funtction from ERC721
    function _mint(address to,uint256 tokenId) internal override(ERC721) {
        super._mint(to, tokenId);
        
        //thm tokens ti owner
        _addFuntionToTotalSupply(tokenId);
        
        
    }

    function _addFuntionToTotalSupply (uint256 tokenId) private {
        _allTokens.push(tokenId);
    }
}

